import config from '@/config';
import Generator from '@/webApi/generator'
export default new Generator({
     //获取上传文件信息
     GetPageAllCodeFilesList: {url: '/printFileCodeService/GetPageAllCodeFilesList', method: 'post'},
      //获取上传文件详细信息
     GetPageAllFileCodesList:{url:'/printFileCodeService/GetPageAllFileCodesList',method:'post'},
     //上传文件信息
     PrintFileUpload:{url:'/printFileCodeService/PrintFileUpload',method:'post'},
}, config.pgyerApiUrl);
